import React from 'react';

const DataTable = () => {
  // Datos estáticos de ejemplo
  const data = [
    { id: 1, nombre: 'Producto A', descripcion: 'Descripción del Producto A', cantidad: 10 },
    { id: 2, nombre: 'Producto B', descripcion: 'Descripción del Producto B', cantidad: 15 },
    { id: 3, nombre: 'Producto C', descripcion: 'Descripción del Producto C', cantidad: 8 },
    { id: 4, nombre: 'Producto D', descripcion: 'Descripción del Producto D', cantidad: 20 },
  ];

  return (
    <div className="container mt-3">
      <h1>Consulta de datos</h1>
      <table id='' className="table table-striped table-bordered">
        <thead className="table-dark">
          <tr>
            <th scope="col">ID</th>
            <th scope="col">Nombre</th>
            <th scope="col">Descripción</th>
            <th scope="col">Cantidad</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item) => (
            <tr key={item.id}>
              <td>{item.id}</td>
              <td>{item.nombre}</td>
              <td>{item.descripcion}</td>
              <td>{item.cantidad}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default DataTable;
